import '../styles/style.css';
import {useState} from "react";

const Form = () => {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [address, setAddress] = useState('');
    const [zipCode, setZipCode] = useState('');
    const [city, setCity] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    const [email, setEmail] = useState('');
    const [springCleaning, setSpringCleaning] = useState(false);
    const [fallCleaning, setFallCleaning] = useState(false);

    const handleFirstName = (e) => {
        setFirstName(e.target.value);
        console.log(firstName.value);
    }

    const handleLastName = (e) => {
        setLastName(e.target.value);
    }

    const handleAddress = (e) => {
        setAddress(e.target.value);
    }

    const handleZipCode = (e) => {
        setZipCode(e.target.value);
    }

    const handleCity = (e) => {
        setCity(e.target.value);
    }

    const handlePhoneNumber = (e) => {
        setPhoneNumber(e.target.value);
    }

    const handleEmail = (e) => {
        setEmail(e.target.value);
    }

    return (
        <div className='form-container'>
            <form className='form'>
                <label>First name: </label>
                <input value={firstName} type={"text"} onChange={handleFirstName}/>
                <label>Last name: </label>
                <input value={lastName} type={"text"} onChange={handleLastName}/>
                <label>Address: </label>
                <input value={address} type={"text"} onChange={handleAddress}/>
                <label>Zip code: </label>
                <input value={zipCode} type={"text"} onChange={handleZipCode}/>
                <label>City: </label>
                <input value={city} type={"text"} onChange={handleCity}/>
                <label>Phone number: </label>
                <input value={phoneNumber} type={"text"} onChange={handlePhoneNumber}/>
                <label>Email address: </label>
                <input value={email} type={"text"} onChange={handleEmail}/>
                <label>Spring cleaning: </label>
                <input value={springCleaning} type={"radio"} onChange={handleFirstName}/>
                <label>Fall cleaning: </label>
                <input value={fallCleaning} type={"radio"} onChange={handleFirstName}/>
            </form>
        </div>
    );
}

export default Form;
